import "./App.css";
import Action from "./view/Action";
import Discription from "./view/Discription";
import Header from "./view/Header";
import HomeSlider from "./view/HomeSlider";

function App() {
  return (
    <>
      <Header />
      <HomeSlider />
      <Discription />
      <Action />
    </>
  );
}

export default App;
